import React from 'react'
import './App.css';
import Customers from './components/Customers.js'
import Test from './components/Test.js'
import Material from './components/Material.js'
import child from './child.jpeg'

function App() {


  return (
    <div className="App">
      <Customers />
      <Test/>
      <Material />
      <img src={child}/>
    </div>
  );
}

export default App;
